import React from 'react';
import { Link } from 'react-router-dom';
import { AppBar, Toolbar, IconButton, Typography, Button, Paper, Grid } from '@mui/material';
import HomeIcon from '@mui/icons-material/Home';
import '../style/HomeBis.css';

function HomeBis() {
  return (
    <div style={{ display: 'flex', flexDirection: 'column', height: '100vh' }}>
      <AppBar position="static" color="inherit" elevation={0}>
        <Toolbar>
          <Link to="/" style={{ textDecoration: 'none', color: 'inherit' }}>
            <IconButton edge="start" color="inherit" aria-label="home">
              <HomeIcon />
            </IconButton>
          </Link>
          <Typography variant="h6" style={{ flexGrow: 1 }}>
            {/* Placeholder for pushing the "Contact" button to the far right */}
          </Typography>
          <Link to="/Contact" style={{ textDecoration: 'none', color: 'inherit' }}>
            <Button color="inherit">Contact</Button>
          </Link>
        </Toolbar>
      </AppBar>

      <div style={{ flexGrow: 1 }}></div> {/* This div pushes the grid to the bottom */}

      <Grid container spacing={3} className="grid-container">
        {[{ route: "/Bio", key: 1 }, { route: "/Projects", key: 2 }, { route: "/Experience", key: 3 }].map((item, index) => (
          <Grid item xs={4} key={item.key} style={{ position: 'relative', left: `${index * (100 / 3)}%` }}>
            <Link to={item.route} style={{ textDecoration: 'none', color: 'inherit' }}>
              <Paper 
                elevation={0} 
                className="grid-item-paper hoverable-grid-item"
              >
                <Paper elevation={5} className="inner-paper" style={{ width: '70%', height: '50%', background: '#EFEFEF' }} />
              </Paper>
            </Link>
          </Grid>
        ))}
      </Grid>
    </div>
  );
}

export default HomeBis;
